import React, { useState, useEffect } from "react";
import styles from "./Header.module.css";

const Header = ({ categories }) => {
  const [isDropdownVisible, setIsDropdownVisible] = useState(false);
  const [visibleCategories, setVisibleCategories] = useState([]);
  const [windowWidth, setWindowWidth] = useState(window.innerWidth);
  const [isBurgerMenuOpen, setIsBurgerMenuOpen] = useState(false);
  const [isSearchVisible, setIsSearchVisible] = useState(
    window.innerWidth >= 767
  );

  useEffect(() => {
    const handleResize = () => {
      setWindowWidth(window.innerWidth);
    };

    handleResize();

    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  useEffect(() => {
    if (windowWidth < 1200) {
      setVisibleCategories([]);
    } else if (windowWidth < 768) {
      setVisibleCategories(categories.slice(0, 1));
    } else if (windowWidth >= 768 && windowWidth < 1024) {
      setVisibleCategories(categories.slice(0, 2));
    } else if (windowWidth >= 1024 && windowWidth < 1400) {
      setVisibleCategories(categories.slice(0, 3));
    } else {
      setVisibleCategories(categories.slice(0, 4));
    }

    setIsSearchVisible(windowWidth >= 767);
  }, [categories, windowWidth]);

  const handleMouseEnter = () => {
    setIsDropdownVisible(true);
  };

  const handleMouseLeave = () => {
    setIsDropdownVisible(false);
  };

  const toggleBurgerMenu = () => {
    setIsBurgerMenuOpen(!isBurgerMenuOpen);
  };

  const toggleSearchVisibility = () => {
    setIsSearchVisible(!isSearchVisible);
  };

  return (
    <div
      className={`flex items-center text-white ${styles.header}`}
      style={{ background: "#FFF" }}
    >
      {/* Logo and Company Name */}
      <div className="flex items-center space-x-4">
        <img style={{ marginRight: "32px" }} crc="/images/Logo.svg"></img>
      </div>
      {windowWidth >= 1200 && (
        <div className="flex items-center space-x-8">
          {visibleCategories.map((category, index) => (
            <a
              key={category}
              href="#"
              className="hover:text-gray-800"
              style={{ color: "#657178" }}
            >
              {category}
            </a>
          ))}
          {categories.length > 3 && (
            <div
              className="relative"
              onMouseEnter={handleMouseEnter}
              onMouseLeave={handleMouseLeave}
            >
              <button
                style={{ color: "#657178" }}
                className="hover:text-gray-300 flex align-center justify-center "
              >
                სხვა
                <svg
                  width="24"
                  height="24"
                  viewBox="0 0 24 24"
                  fill="none"
                  xmlns="http://www.w3.org/2000/svg"
                >
                  {/* SVG Paths */}
                </svg>
              </button>
              {isDropdownVisible && (
                <div className="absolute bg-white w-80 shadow-lg rounded mt-2">
                  {categories
                    .slice(visibleCategories.length)
                    .map((category) => (
                      <a
                        key={category}
                        href="#"
                        className="block px-4 py-2 text-gray-800 hover:bg-gray-200"
                      >
                        {category}
                      </a>
                    ))}
                </div>
              )}
            </div>
          )}
        </div>
      )}

      {/* Social Icons and Search Bar */}
      <div
        className={`flex items-center space-x-4 ${styles.searchcontent}`}
        style={{ marginLeft: "auto", marginRight: "0px" }}
      >
        <div
          style={{
            width: "32px",
            height: "32px",
            padding: "8.5px",
            borderRadius: "50%",
            background: "#F5F8FF",
          }}
        ></div>
        <div
          style={{
            width: "32px",
            height: "32px",
            padding: "8.5px",
            borderRadius: "50%",
            background: "#F5F8FF",
          }}
        ></div>

        {isSearchVisible && (
          <div className="relative">
            <input
              type="text"
              placeholder="ძიება"
              className={`focus:outline-none ${styles.search}`}
            />
            <div className="absolute right-4 top-1/2 transform -translate-y-1/2"></div>
          </div>
        )}

        <button onClick={toggleSearchVisibility}>
          <svg
            width="24"
            height="24"
            viewBox="0 0 24 24"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            {/* Icon SVG Paths */}
          </svg>
        </button>
      </div>
      <div className={styles.burgermenu}>
        {/* Render burger menu here */}
        <button onClick={toggleBurgerMenu}>
          <svg
            width="24"
            height="24"
            viewBox="0 0 24 24"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            <path
              fillRule="evenodd"
              clipRule="evenodd"
              d="M3 8V6H21V8H3ZM3 13H21V11H3V13ZM3 18H21V16H3V18Z"
              fill="#1D2D35"
            />
          </svg>
        </button>
        {isBurgerMenuOpen && (
          <div
            className="fixed top-0 left-0 w-screen h-screen bg-white z-50 flex flex-col justify-center items-center"
            onClick={toggleBurgerMenu}
          >
            {categories.map((category) => (
              <a
                key={category}
                href="#"
                className="text-gray-800 hover:bg-gray-200 py-2"
              >
                {category}
              </a>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Header;
